import React from 'react'
import { Box, Button, Typography } from '@mui/material'

const QuestionButton = ({text, onClick}) => {
    return (
        <Box             
            width='100%'
            mx={3}
        >
            <Button
                variant="text"
                onClick={onClick}
            >
                <Typography variant="h6">
                    {text}
                </Typography>
            </Button>
        </Box>
    )
}

export default QuestionButton
